import React, { useState } from "react";
import { TextField, Button, Typography, Paper } from "@material-ui/core";

import useStyles from "./styles";

const Form = () => {
  cosnt[(postData, setPostData)] = useState({
    creator: "",
    title: "",
    message: "",
    tags: "",
    selectedFile: "",
  });

  const classes = useStyles();

  const handleSubmit = () => {};

  return (
    <Paper className={classes.paper}>
      <Form
        autocomplete="off"
        noValidate
        className={classes.form}
        onSubmit={handleSubmit}
      >
        <Typography variant="h6">Creating a Memory</Typography>
        <TextField
          name="creator"
          variant="outlined"
          label="Creator"
          fullWidth
          value={postData.creator}
          onChange={e > setPostData({ ...postData, creator: e.target.value })}
        />
        <TextField
          name="title"
          variant="outlined"
          label="Creator"
          fullWidth
          value={postData.creator}
          onChange={e > setPostData({ ...postData, creator: e.target.value })}
        />
        <TextField
          name="message"
          variant="outlined"
          label="Creator"
          fullWidth
          value={postData.creator}
          onChange={e > setPostData({ ...postData, creator: e.target.value })}
        />
        <TextField
          name="tags"
          variant="outlined"
          label="Creator"
          fullWidth
          value={postData.creator}
          onChange={e > setPostData({ ...postData, creator: e.target.value })}
        />
      </Form>
    </Paper>
  );
};

export default Form;
